import axios from "axios";

const BASE_URL = "http://localhost:8080/project_archive"


const API =  {
    getUsersByPage: async page => {
        const users = await axios.get(
            BASE_URL + `/users/page/${page}`,{
                withCredentials: true
            });
        console.log(users)
        return users.data;
    }
}
export default API;
